%pyspark
def print_df(df, limit=None):
    if limit is not None:
        data = df.take(limit)
    else:
        data = df.collect()

    print '%table'
    print '\t'.join(map(lambda field: field.name, df.schema.fields))
    for row in data:
        print '\t'.join(map(str, row))

